class NamingACompany {
    func distinctNames(_ ideas: [String]) -> Int {
        var map: [Character: Set<String>] = [:]
        for idea in ideas {
            map[idea.first!, default: []].insert(String(idea.dropFirst()))
        }
        guard map.count > 1 else { return 0 }
        let array = Array(map.values)
        var result = 0
        for (i, chars) in array.enumerated() {
            for j in i+1..<array.count {
                let chars2 = array[j]
                let interCount = chars.intersection(chars2).count
                result += (chars.count - interCount) * (chars2.count - interCount)
            }
        }
        return result * 2
    }

